import "./App.css";
import Axios from "axios";

export default function getEmployees() {
  var employeeList = [];
  Axios.get("http://localhost:3001/employees").then((response) => {
    employeeList = response.data;
    //console.log(response.data);
    return employeeList;
  });
}
